import ProjectBox from './ProjectBox'

const info = [
  {name:"onehitwonder", content:"xyz"},
  {name:"2hitwonder", content:"2"},
  {name:"3hitwonder", content:"3"},
]

function ProjectComponents() {
  return (
    <div>
      {
          info.map((i,index) => (
            <div>{i.name}</div>

          )
        )  
        }
    </div>
  )
}

export default ProjectComponents
